import React, {Fragment} from 'react';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import Home from './components/pages/Home';
import About from './components/pages/About';
import Navbar from './components/layout/Navbar';
import Register from './components/auth/Register';
import Login from './components/auth/Login';
import Alerts from './components/layout/Alerts';
import PrivateRoute from './components/routing/PrivateRoute';

import ContactState from './context/contact/ContactState';
import AuthState from './context/auth/AuthState';
import AlertState from './context/alert/AlertState';
// import setAuthToken from './utiles/setAuthToken';
import './App.css';


// if(localStorage.token){
//   setAuthToken(localStorage.token);
// }

const App = () => {
  return (
    <AuthState>
      <ContactState>
        <AlertState>
          <Router>
            <Fragment >
              <Navbar />
              <div className="container">
                <Alerts />
                <Routes>
                  <Route exact path='/' component={Home} element={<Home />}/>
                  <Route exact path='/about' component={About} element={<About />}/>
                  <Route exact path='/register' component={Register} element={<Register />}/>
                  <Route exact path='/login' component={Login} element={<Login />}/>
                </Routes>
              </div>
            </Fragment>
          </Router>
        </AlertState>
      </ContactState>
    </AuthState>
  );
}

export default App;
